    } else {
      throw new TypeError('Length must be a number');
    }
  }

  set students(arraryStudent) {
    if (arraryStudent instanceof Array) {
      this.students = arraryStudent;
    } else {
      throw new TypeError('Students must be an array');
    }
  }
}

